    render() {
        return (

            <Row className="justify-content-center">
                <Col md="4">
                    <Form.Group controlId="formSearch">
                    <Form.Control type="text" placeholder="Search" />
                    </Form.Group>
                </Col>
            </Row>
        )
    }
}


